import { RouterProvider, createBrowserRouter } from "react-router-dom";
import RootLayout from "./pages/RootLayout";
import Home from "./pages/Home";
import Events from "./pages/Events";
import EventDetailPage from "./pages/EventDetailPage";
import NewEventsPage from "./pages/NewEventPage";
import RootEventsNav from "./pages/RootEventsNav";
import axios from "axios";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    children: [
      { path: "/", element: <Home /> },
      {
        path: "/events",
        element: <RootEventsNav />,
        children: [
          {
            path: "/events",
            element: <Events />,
            loader: async () => {
              // const response = await fetch("http://localhost:8080/events");

              // if (!response.ok) {
              //   console.log("Fetching events failed.");
              // } else {
              //   const resData = await response.json();
              //   return resData.events;
              // }

              const response = await axios
                .get("http://localhost:8080/events")

            },
          },
          {
            path: "/events/:eventId",
            element: <EventDetailPage />,
            children: [
              { path: "/events/:eventId", element: <EventDetailPage /> },
              { path: "/events/:eventId/edit", element: <EventDetailPage /> },
            ],
          },
          { path: "/events/new", element: <NewEventsPage /> },
        ],
      },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
